INSERT INTO `Referti` VALUES (22,'REFERTO ECOGRAFICO\r\n\r\nPaziente: Luca Ferri\r\nData: 20 luglio 2023\r\n\r\nIl presente referto attesta che l\'ecografia sottoposta dal paziente Luca Ferri  stata eseguita con successo. Durante l\'esame ecografico, sono state utilizzate tecniche di imaging ad ultrasuoni per visualizzare gli organi interni del paziente. L\'obiettivo dell\'ecografia era valutare lo stato dell\'addome.\r\n\r\nDurante l\'esame, sono state analizzate diverse strutture, tra cui il fegato, la milza, i reni, la vescica e l\'addome in generale. Non sono state rilevate anomalie o patologie significative durante l\'ecografia. Le immagini acquisite mostrano una normale anatomia e funzionalit degli organi esaminati.\r\n\r\nIl paziente ha collaborato attivamente durante l\'intero processo dell\'ecografia, consentendo una buona visualizzazione delle strutture e facilitando la raccolta di dati accurati.\r\n\r\nIn conclusione, l\'ecografia diagnostica eseguita sul paziente Luca Ferri  stata completata con successo e non ha rivelato alcuna anomalia significativa. Si consiglia di confrontare i risultati con i dati clinici e di eseguire ulteriori esami, se necessario, per una valutazione medica completa.\r\n\r\nDott. Giovanni Bianchi\r\nMedico Radiologo'),(31,'REFERTO MAMMOGRAFICO\r\n\r\nPaziente: Sofia Conti\r\nData: 13 luglio 2023\r\n\r\nIl presente referto attesta che la mammografia sottoposta dalla paziente Sofia Conti  stata eseguita con successo. La mammografia  una procedura radiologica utilizzata per esaminare le ghiandole mammarie al fine di rilevare eventuali anomalie o patologie.\r\n\r\nDurante l\'esame mammografico, sono state acquisite immagini dettagliate delle ghiandole mammarie utilizzando una macchina radiologica specializzata. L\'obiettivo della mammografia era la valutazione dello stato delle mammelle al fine di rilevare segni di eventuali tumori o altre anomalie.\r\n\r\nLe immagini ottenute durante la mammografia di Sofia Conti sono state attentamente analizzate. Non sono state rilevate aree sospette o masse tumorali che possano indicare la presenza di un tumore al seno. Le mammelle della paziente presentano un aspetto normale e omogeneo nelle immagini acquisite.\r\n\r\n importante sottolineare che la mammografia non  un esame diagnostico definitivo. In caso di sintomi o anomalie rilevate durante l\'autoesame o la visita medica, si consiglia di consultare un medico specialista per ulteriori valutazioni diagnostiche.\r\n\r\nIn conclusione, la mammografia diagnostica eseguita sulla paziente Sofia Conti  stata completata con successo e non ha rilevato alcuna anomalia significativa. Si consiglia di continuare a seguire le linee guida per la prevenzione e la diagnosi precoce del tumore al seno.\r\n\r\nDott.ssa Laura Bianchi\r\nMedico Radiologo');
